// src/components/navLinks.js
export const navLinks = [
  { name: "Home", path: "/" },
  { name: "Investor", path: "/investor" },
  { name: "Brand", path: "/brand" },
  { name: "Terms", path: "/terms" },
  { name: "Privacy", path: "/privacy" },
  { name: "No Refund", path: "/norefund" },
];
